cypher:
MATCH (a:Adult)-[:PRODUCED_BY]->(c:ProductionCompany)
WHERE NOT EXISTS { (c)-[:PRODUCED_IN_COUNTRY]->(:Country {name: 'United States of America'}) }
RETURN a.title AS `Adult Film`, c.name AS `Production Company`

MATCH (m:Movie)-[:SPOKEN_IN_LANGUAGE]->(l1:Language {name: 'English'})
WHERE EXISTS {
  (m)-[:SPOKEN_IN_LANGUAGE]->(:Language {name: 'Spanish'})
}
RETURN m.title
LIMIT 3

MATCH (m:Movie)-[:IN_COLLECTION]->(c:Collection)
WHERE EXISTS {
  (m)-[:IN_GENRE]->(g1:Genre)
  WHERE NOT EXISTS {
    (c)-[:IN_GENRE]->(g2:Genre)
    WHERE g1.name = g2.name
  }
}
RETURN m.title, c.name
LIMIT 5

MATCH (m:Movie)
WHERE m.status = 'Released' AND exists {
  (m)-[:HAS_KEYWORD]->(:Keyword {name: 'in production'})
}
RETURN m.title
LIMIT 3

MATCH (a:Adult)
WHERE NOT EXISTS {
  (a)-[:PRODUCED_IN_COUNTRY]->(:Country)
}
RETURN a.title
LIMIT 3

MATCH (p:Person)-[:CAST_FOR]->(m:Movie)
WHERE EXISTS {
  (p)-[:CAST_FOR]->(:Adult)
}
RETURN p.name
LIMIT 5

MATCH (m:Movie)-[:ORIGINAL_LANGUAGE]->(l:Language {name: 'Italian'})
WHERE exists{ (m)-[:HAS_KEYWORD]->(:Keyword {name: 'award won'}) }
RETURN m.title

MATCH (m:Movie)-[:PRODUCED_IN_COUNTRY]->(:Country {name: 'United States of America'})
WHERE exists {(u:User)-[:RATED]->(a:Adult)<-[:RATED]-(u)-[:RATED]->(m)} 
RETURN m.title

MATCH (m:Movie)-[:SPOKEN_IN_LANGUAGE]->(l1:Language {name: 'English'})
WHERE exists{ (m)-[:SPOKEN_IN_LANGUAGE]->(:Language {name: 'Spanish'}) }
RETURN m.title

MATCH (m:Movie {id: 862})<-[:CREW_FOR]-(p:Person)
WHERE exists{ (p)-[:CREW_FOR {job: 'Director'}]->(m) }
RETURN p.name AS director

MATCH (g:Genre)
WHERE NOT EXISTS {
  (g)<-[:IN_GENRE]-(:Movie)-[:HAS_KEYWORD]->(:Keyword)
}
RETURN g.name
LIMIT 3

MATCH (p:Person)-[:CREW_FOR]->(m:Movie)
WHERE (p)-[:CREW_FOR]->(:Adult)
  AND exists{ (p)-[:CREW_FOR {job: 'Director'}]->(:Movie) }
  AND exists{ (p)-[:CREW_FOR {job: 'Director'}]->(:Adult) }
RETURN p.name
LIMIT 3

MATCH (m:Movie)-[:PRODUCED_IN_COUNTRY]->(c:Country)
WHERE NOT EXISTS {
  (m)-[:ORIGINAL_LANGUAGE]->(:Language {name: 'English'})
}
RETURN m.title AS movie, c.name AS country
